import { Grid } from '@mui/material';

import "./App.css"

const App = () => {
  return (
    <>
      <Header/>
      <Grid container spacing={2}>
        <Grid item xs={8} sm={9} >
             <Home/>
          </Grid> 
          <Grid item xs={5} sm={3}>
            <Sidebar/>
          </Grid>


      </Grid>
      <Footer/>

    </>
  )
}

export default App
